"use strict";(globalThis.webpackChunkavstudio_docs=globalThis.webpackChunkavstudio_docs||[]).push([[8478],{46558:e=>{e.exports=JSON.parse('{"tag":{"label":"elements","permalink":"/avstudio-docs/tags/elements","allTagsPath":"/avstudio-docs/tags","count":19,"items":[{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-1-button/4-4-5-1-button","title":"Button Element","description":"The Button is one of the most commonly used elements in AVStudio. It can be used to trigger actions, navigate between pages, or toggle visibility of components.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-1-button/"},{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-2-checkbox/4-4-5-2-checkbox","title":"Checkbox Element","description":"The Checkbox element in AVStudio allows users to toggle a value on or off. It\'s useful for filtering, form controls, or triggering logic based on user interaction.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-2-checkbox/"},{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-9-colorpicker/4-4-5-9-colorpicker","title":"Color Picker","description":"The Color Picker element allows users to select any RGB color dynamically. It is fully responsive and adapts to the parent container\u2019s size.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-9-colorpicker/"},{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-elements","title":"Elements","description":"Each container in AVstudio can hold one or more elements. These elements define the actual content or controls inside your layout\u2014such as buttons, sliders, inputs, or embedded widgets.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/"},{"id":"avstudio-editor/working-with-projects/4-5-adding-elements/4-5-adding-elements","title":"How to Add an Element","description":"Learn how to add elements to your AVstudio project using the Page Containers panel, the editor context menu, or drag-and-drop.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-5-adding-elements/"},{"id":"avstudio-editor/working-with-projects/4-7-assigning-dynamic-values/4-7-assigning-dynamic-values","title":"How to Assign Dynamic Values","description":"Learn how to assign dynamic values to element fields in AVstudio using the Pick Dynamic Value modal.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-7-assigning-dynamic-values/"},{"id":"avstudio-editor/working-with-projects/4-6-configuring-dimensions/4-6-configuring-dimensions","title":"How to Configure Dimensions","description":"Learn how to adjust element width and height in AVstudio using pixels, percentages, or dynamic values, plus inheritance tips.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-6-configuring-dimensions/"},{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-15-circle-slider/4-4-5-15-circle-slider","title":"How to Use the Circle Slider Element","description":"Learn how to configure and customize the Circle Slider element in AVStudio, including data sources, design settings, and value display options.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-15-circle-slider/"},{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-16-htmlblock/4-4-5-16-htmlblock","title":"How to Use the HTML Block Element","description":"Guide for configuring and using the HTML Block element in AVstudio \u2014 content, dataset source, styling and common use cases.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-16-htmlblock/"},{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-14-player/4-4-5-14-player","title":"How to Use the Player Element","description":"Learn how to use and configure the Player element in AVStudio, including its properties, playback data, and state options.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-14-player/"},{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-4-image/4-4-5-4-image","title":"Image","description":"The Image element allows you to display images inside your project layout, with options for size, stretching behavior, and positioning.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-4-image/"},{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-5-keypad/4-4-5-5-keypad","title":"Keypad","description":"The Keypad element provides a customizable on-screen keypad that users can interact with. This element is often used for numeric entry, PIN input, or other forms of digital control. The Keypad element can be static or dynamic, with various size and mode options.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-5-keypad/"},{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-8-roundslider/4-4-5-8-roundslider","title":"Round Slider Element","description":"The Round Slider element in AVStudio provides a circular slider interface that can display or control values. It is useful for volume controls, progress indicators, or any scenario where a round, interactive slider is preferred.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-8-roundslider/"},{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-7-slider/4-4-5-7-slider","title":"Slider Element","description":"The Slider element provides a linear slider for adjusting or displaying values such as volume, brightness, or progress.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-7-slider/"},{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-11-subpage/4-4-5-11-subpage","title":"Subpage","description":"Learn how to add and configure Subpage elements in AVStudio, including layout, appearance, and action properties.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-11-subpage/"},{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-12-subpage-list/4-4-5-12-subpage-list","title":"Subpage List","description":"The Subpage List element allows you to display and manage multiple subpages within a container. It\u2019s useful for showing repeating layouts, dynamic lists, or collections of content that share the same subpage structure.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-12-subpage-list/"},{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-10-switch/4-4-5-10-switch","title":"Switch","description":"Learn how to add and configure the Switch element in AVStudio, including sizing, design, text, and action settings.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-10-switch/"},{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-6-text/4-4-5-6-text","title":"Text","description":"The Text element allows you to display static or dynamic text content within your project. It supports flexible data binding, making it useful for both labels and dynamic data displays.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-6-text/"},{"id":"avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-13-video/4-4-5-13-video","title":"Video","description":"How to add and configure the Video element in AVStudio, including poster images, playback options, actions, and visibility.","permalink":"/avstudio-docs/avstudio-editor/working-with-projects/4-4-page-properties/4-4-5-elements/4-4-5-13-video/"}],"unlisted":false}}')}}]);